func testOptaFeedItemVersionToManyRemoveOpCurrentVersionOptaFeedItems(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer func() { _ = tx.Rollback() }()

	var a OptaFeedItemVersion
	var b, c, d, e OptaFeedItem

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, optaFeedItemVersionDBTypes, false, strmangle.SetComplement(optaFeedItemVersionPrimaryKeyColumns, optaFeedItemVersionColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*OptaFeedItem{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, optaFeedItemDBTypes, false, strmangle.SetComplement(optaFeedItemPrimaryKeyColumns, optaFeedItemColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	err = a.AddCurrentVersionOptaFeedItems(tx, true, foreigners...)
	if err != nil {
		t.Fatal(err)
	}

	count, err := a.CurrentVersionOptaFeedItems().Count(tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 4 {
		t.Error("count was wrong:", count)
	}

	err = a.RemoveCurrentVersionOptaFeedItems(tx, foreigners[:2]...)
	if err != nil {
		t.Fatal(err)
	}

	count, err = a.CurrentVersionOptaFeedItems().Count(tx)
	if err != nil {
		t.Fatal(err)
	}
	if count != 2 {
		t.Error("count was wrong:", count)
	}

	if !queries.IsValuerNil(b.CurrentVersionID) {
		t.Error("want b's foreign key value to be nil")
	}
	if !queries.IsValuerNil(c.CurrentVersionID) {
		t.Error("want c's foreign key value to be nil")
	}

	if b.R.CurrentVersion != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if c.R.CurrentVersion != nil {
		t.Error("relationship was not removed properly from the foreign struct")
	}
	if d.R.CurrentVersion != &a {
		t.Error("relationship to a should have been preserved")
	}
	if e.R.CurrentVersion != &a {
		t.Error("relationship to a should have been preserved")
	}

	if len(a.R.CurrentVersionOptaFeedItems) != 2 {
		t.Error("should have preserved two relationships")
	}

	// Removal doesn't do a stable deletion for performance so we have to flip the order
	if a.R.CurrentVersionOptaFeedItems[1] != &d {
		t.Error("relationship to d should have been preserved")
	}
	if a.R.CurrentVersionOptaFeedItems[0] != &e {
		t.Error("relationship to e should have been preserved")
	}
}

